function BottomHeader(){

    return(
        <div className="w-screen border-b-2 border-white/10 mt-auto">
            <div id="navbar" className="grid grid-cols-1 gap-2 sm:gap-0 sm:grid-cols-3"> {/* Use grid-cols-3 for larger screens */}
                <div id="logo-div" className=" items-center mx-auto sm:mx-0 sm:pl-32 sm:col-span-1"> {/* Adjust padding and col-span for small screens */}
                    <img alt="logo" src="/logo.png" className="h-14 w-auto" />
                </div>
                <div id="title-div" className="flex items-center justify-center sm:col-span-1"> {/* Adjust col-span for small screens */}
                    <h1 className="font-bold font-italics text-2xl">WSB ANALYTICS.</h1>
                </div>
                <div id="link-div" className="flex flex-col sm:flex-row justify-between items-center sm:items-start border pl-2 pr-2 sm:pl-8 sm:col-span-1"> {/* Adjust padding and col-span for small screens */}
                    <a href="https://opensource.org/license/mit" target="_blank" className="font-sm sm:text-center font-thin w-2/6">Use under MIT License</a>
                    <a className="font-thin w-2/6">OpenHermes-7B</a>
                    <h1 className="font-thin w-2/6">How it works</h1>
                </div>
            </div>
        </div>
    );

}
export default BottomHeader
